INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (100, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 2, 1, 130011, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", -416.5, 3001100, 0.0, 3001, "ヤマト", 2.1);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (101, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 2, 4, 130011, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", -416.5, 3001101, 0.0, 3001, "ヤマト", 5.68);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (102, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 1, 130011, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", -416.5, 3001102, 0.0, 3001, "ヤマト", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (100, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 1, 130211, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", -416.5, 3002100, 0.0, 3002, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (101, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 1, 130211, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", -416.5, 3002101, 0.0, 3002, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (102, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 2, 5, 130211, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", -416.5, 3002102, 0.0, 3002, "フブキ", 8.53);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (103, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 7, 130211, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", -416.5, 3002103, 0.0, 3002, "フブキ", 5.67);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (104, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 1, 130211, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", -416.5, 3002104, 0.0, 3002, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (300, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3, 3, 130211, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", -416.5, 3002300, 0.0, 3004, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (301, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 7, 7, 130211, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", -416.5, 3002400, 0.0, 3005, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (200, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 2, 130211, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", -416.5, 3003200, 0.0, 3003, "フブキ", 4.4);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (201, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 7, 7, 130211, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", -416.5, 3003201, 0.0, 3003, "フブキ", 0.0);
INSERT INTO `v1_08b462e73ee8b6194ab473db71d1621a861f0e32f35b77f66a32089ff8bafa52` VALUES (202, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 2, 1, 130211, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", -416.5, 3003202, 0.0, 3003, "フブキ", 5.6);
